import React from 'react';
import {Grid} from '@material-ui/core';
import Tea from './Tea/Tea';
import useStyles from './styles'

const products = [
    {id: 1, name: 'Black Tea', description: 'loose leaf black tea', price: '$5', image: 'blkt.jpg'},
    {id: 2, name: 'Green Tea', description: 'loose leaf black tea', price: '$5', image: 'grnt.jpg'},
    {id: 3, name: 'White Tea', description: 'loose leaf black tea', price: '$5', image: 'wht.jpg'},
    {id: 4, name: 'Oolong Tea', description: 'loose leaf black tea', price: '$5', image: 'oolngt.jpg'},
    {id: 5, name: 'Matcha', description: 'loose leaf black tea', price: '$5', image: 'matcha.jpg'},
]
 




const Products = () => {
    const classes = useStyles();

    return (

        <main className={classes.content}>
        <div className={classes.toolbar}/>
        <Grid container justify='center' spacing={4}>
            {products.map((product) => (
                <Grid item key ={product.id} xs={12} sm={6} md={4} lg={3}> 
                <Tea product={product} />
                </Grid>
            ))}
        </Grid>
        </main>

    )};

export default Products;
